const Stock = {
    search(APIid){
        return {
            type: "line",
            name: "TestChart",
            showInLegend: true,
            dataPoints: [
                { y: 155, label: "Jan34" },
                { y: 150, label: "Feb34" },
                { y: 152, label: "Mar34" },
                { y: 148, label: "Apr34" },
                { y: 142, label: "Maydf" },
                { y: 150, label: "Judfn" },
                { y: 146, label: "Judfl" },
                { y: 149, label: "Ausdfg" },
                { y: 153, label: "Sesdfpt" },
                { y: 158, label: "Ofdbct" },
                { y: 154, label: "abfNov" },
                { y: 150, label: "Dsdfec" }
            ]
        }
    }
}

export default Stock
